import axios from 'axios';
import React, { useEffect, useState } from 'react'

const Equipments = () => {

    const [equipment,setEquipment]=useState([]);

    useEffect(()=>{
       const fetchData = async(e)=>{
        await axios.get('http://localhost:3000/api/equipment')
        .then(response=>setEquipment(response.data))
        .catch(err=>console.log(err));
       };
       fetchData();
    },[])

  return (
    <div>
        <table style={{border:"1px solid black"}}>
            <thead style={{width:"100px"}}>
                <tr>
                    <th>Id</th>
                    <th>Name</th>
                    <th>Type</th>
                    <th>Status</th>
                    <th>Action</th>
                </tr>
            </thead>
            <tbody>
                {equipment.map((eq)=>(
                    <tr key={eq.id}>
                        <td>{eq.id}</td>
                        <td>{eq.name}</td>
                        <td>{eq.type}</td>
                        <td>{eq.status}</td>
                        <td>{eq.lastcleandate}</td>
                    </tr>
                ))}
            </tbody>
        </table>
    </div>
  )
}

export default Equipments
